import React, { Component } from 'react';
import OwlCarousel from 'react-owl-carousel2';
import nature from '../download.jpeg';
import Head from 'next/head'
// import 'react-owl-carousel2/style.css'; //Allows for server-side rendering.



export default class componentName extends Component {
  render() {
    const options = {
        items: 1,
        nav: true,
        rewind: true,
        autoplay: true
    };
    return (
      <>
      <Head>
      <script src="https://code.jquery.com/jquery-3.2.1.slim.min.js"></script>
      {/* <link rel="stylesheet" href="owl-carousel/owl.theme.css"/> */}
      </Head>
      <div>
          hello
          <img src={nature} />
        <OwlCarousel ref="car" options={options}  >
            <div><img src={nature} alt="The Last of us"/></div>
            <div><img src={nature} alt="GTA V"/></div>
            <div><img src={nature} alt="Mirror Edge"/></div>
        </OwlCarousel>
      </div>

      </>
    )
  }
}
